    false,nt"url": null,nt"notes": "The Lower Souris Migratory Waterfowl Refuge
    (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
    of the Canadian border in North Dakota. The refuge was established and constructed
    by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
    events taking place on the refuge in January of 1936. Within this report are accounts
    of the harsh winter the refuge had received as well as updates on projects taking
    place, such as: food and cover planting, fish shelters and nesting islands, the
    goose pen, preparatory work, education, and the possible establishment of a new
    refuge. Photographs conclude the report.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
